import React from "react";
import {Image, Popup, Rating} from 'semantic-ui-react';

function element(){

    return(
        <div id="element">
            <Popup.Content>
                trigger={<Image  src='../img/tayara.png' size="tiny"></Image>}
                content={<Rating defaultRating={3} maxRating={5} disabled />}
                on='click'
                hideOnScroll
                
            >
            </Popup.Content>
           
        </div>
    )
}


export default element;
